      real_t a_0_2 = tmp_19;
      real_t a_1_0 = tmp_17;
      real_t a_1_1 = 0.5*tmp_21;
      real_t a_1_2 = tmp_23;
      real_t a_2_0 = tmp_19;
      real_t a_2_1 = tmp_23;
      real_t a_2_2 = 0.5*tmp_24;
      elMat( 0, 0) = a_0_0;
      elMat( 0, 1) = a_0_1;
      elMat( 0, 2) = a_0_2;
      elMat( 1, 0) = a_1_0;
      elMat( 1, 1) = a_1_1;
      elMat( 1, 2) = a_1_2;
      elMat( 2, 0) = a_2_0;
      elMat( 2, 1) = a_2_1;
      elMat( 2, 2) = a_2_2;
